import React from 'react'

export function RoomsList({ renderedRooms }) {
    return (
        <div className="rooms-list bg-light">
            <table className="table">
                <tbody>
                    {renderedRooms}
                    <div><i class="bi bi-plus"></i></div>
                </tbody>
            </table>

        </div>
    )
}
